import React, { useState } from "react";

function Input (){
    const {text,setText} = useState("")

    function onch(event) {
        setText(event.target.value)
        
    }

    return(
        <div>
            <br></br>
            <from>
                <input onChange={onch} type="text"></input>
                <button> ok </button>
            </from>

            <ul>
                <li>{text}</li>
            </ul>
        </div>
        
        
    )

}


export default Input;




